import React from 'react';
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import SecondaryLayout from "../../layout/SecondaryLayout";
import {ExtLink} from "../../common/CustomButtons"

export default function OrderFormSucceed(props) {
    return (
        <SecondaryLayout>
            <Box justifyContent="center" m="auto">
                <Box>
                    <Typography align="center" variant="h4">
                        Заявка успешно отправлена
                    </Typography>
                </Box>
                <Box>
                    <Typography align="center" variant="h6" color="textSecondary">
                        Вы можете <ExtLink href="https://steamcommunity.com/profiles/76561198201642689"
                                                 target="_blank">добавить</ExtLink> меня
                        в друзья для обсуждения деталей
                        заказа прежде, чем я Вас
                    </Typography>
                </Box>
            </Box>
        </SecondaryLayout>
    );
}
